    public static int findMaxConsecutiveOnes(int[] nums) {
        int end = 0;
        int start = 0;
        int max = 0;
        for (int i = 0; i < nums.length; i++) {

            if (nums[i] != 1) {
                start = i;
            }

            if (nums[i] == 1) {
                ++end;
                max = Math.max(max, end - start);
            }
        }
        return max;
    }

    public static int findMaxConsecutiveOnes2(int[] nums) {
        int max = 0;
        int count = 0;
        for (int i = 0; i < nums.length; i++) {
            if (nums[i] == 1) {
                count++;
            } else {
                if (count > max) {
                    max = count;
                }
                count = 0;
            }
        }

        if (count > max) {
            max = count;
        }
        return max;
    }
